import React from 'react';
import {Typography, AppBar  ,Toolbar ,Container} from '@mui/material'
import logo from './atoms/images/logo.png';
import Image from './atoms/Image'
import User from './atoms/User'
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import Icons from './atoms/Icons';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles(theme => ({
    avatar: {
      position: 'absolute',
      left:'75%',
       },
    arrow:{
      color: 'black',
      position: 'absolute',
      left:'74.69%'
    },
    search:{color: 'black',
      position: 'absolute',
      left: '23.69%',
      right: '7.03%',
      top: '34.88%',
      bottom: '7.03%'},
    logo:{position: 'absolute',
      left: '17.36%',
      right: '74.02%',
      top: '34.88%',
      bottom: '34.88%'
    },
  explore:{
      color: 'black',
      position: 'absolute',
      fontSize: '16px',
      fontStyle: 'normal',
      fontWeight: '500',
      lineHeight: '20px',
      letterSpacing: '0em',
      textAlign: 'left',
      left:'28.69%'
  },
  myLib:{
    color: 'black',
        position: 'absolute',
        left:'35.69%',
        fontSize: '16px',
        fontStyle: 'normal',
        fontWeight: '500',
        lineHeight: '20px',
        letterSpacing: '0em',
        textAlign: 'left'
  }
  })); 

interface Props{

}

const Menu=(props:Props)=> {
    const classes= useStyles()
    return (
    <div>
      <AppBar  style={{ background: '#FFFFFF'}} position='relative'>
      <Toolbar>
      <Image className={classes.logo} path={logo} />

      <Icons className={classes.search}>
      <SearchOutlinedIcon/>
      </Icons>

      <Typography variant='body1' className={classes.explore}>Explore</Typography>

      <KeyboardArrowDownIcon style={{ color: 'black',
      position: 'absolute',
      left:'31.69%',}}/>

      <Typography variant='body1' className={classes.myLib}>My Library</Typography>

      <User className={classes.avatar}  username="B" />

      <Icons className={classes.arrow}>
        <KeyboardArrowDownIcon />
      </Icons>

      </Toolbar>
    </AppBar>

        </div>
    );
}

export default Menu;
